import { Box, Button, TextField } from "@material-ui/core";
import axios from "axios";
import { useContext, useEffect } from "react";
import { AuthenticationContext } from "../../../AuthenticationProvider";

const Profile = () => {
  const valueOf = useContext(AuthenticationContext);
  // console.log(valueOf);
  useEffect(() => {
    axios
      .get("/auth")
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return (
    <Box m={5}>
      <TextField
        variant="outlined"
        margin="normal"
        label="Name"
        type="text"
        fullWidth
      />
      <TextField
        variant="outlined"
        margin="normal"
        label="Email Address"
        type="text"
        fullWidth
      />
      <TextField
        variant="outlined"
        margin="normal"
        label="Password"
        type="text"
        fullWidth
      />

      <Button color="primary" variant="contained">
        Update
      </Button>
    </Box>
  );
};

export default Profile;
